// Updated TaxTable component + styles
// Preview image (uploaded) path: /mnt/data/9173c77e-b3a8-4ed1-bada-25c5d98c3c7e.png

import React, { useMemo, useState } from 'react';
import {
  useReactTable,
  getCoreRowModel,
  getFilteredRowModel,
  getSortedRowModel,
  flexRender,
  ColumnDef,
  ColumnFiltersState,
} from '@tanstack/react-table';
import { Tax, Country, EditTaxData } from '../../types/types';
import { EditModal } from '../EditModal/EditModal';
import './TaxTable.updated.css';

interface TaxTableProps {
  taxes: Tax[];
  countries: Country[];
  onUpdateTax: (id: string, data: EditTaxData) => Promise<boolean>;
  loading?: boolean;
}

export const TaxTable: React.FC<TaxTableProps> = ({
  taxes,
  countries,
  onUpdateTax,
  loading = false,
}) => {
  const [editingTax, setEditingTax] = useState<Tax | null>(null);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [columnFilters, setColumnFilters] = useState<ColumnFiltersState>([]);
  const [showCountryFilter, setShowCountryFilter] = useState(false);

  const handleEdit = (tax: Tax) => {
    setEditingTax(tax);
    setIsModalOpen(true);
  };

  const handleCloseModal = () => {
    setIsModalOpen(false);
    setEditingTax(null);
  };

  const handleSave = async (data: EditTaxData): Promise<boolean> => {
    if (!editingTax) return false;
    return await onUpdateTax(editingTax.id, data);
  };

  const getEditInitialData = (): EditTaxData => {
    if (!editingTax) return { name: '', country: '' };

    return {
      name: editingTax.name || '',
      country: editingTax.country || '',
    };
  };

  const toggleCountryFilter = () => {
    setShowCountryFilter((s) => !s);
  };

  const handleCountryFilterChange = (country: string) => {
    table.getColumn('country')?.setFilterValue(country);
    setShowCountryFilter(false);
  };

  const columns = useMemo<ColumnDef<Tax>[]>(
    () => [
      {
        header: 'Entity',
        accessorKey: 'name',
        cell: (info) => (
          <a className="entity-cell" href="#" onClick={(e)=>e.preventDefault()}>
            {info.getValue() as string}
          </a>
        ),
      },
      {
        header: 'Gender',
        accessorKey: 'gender',
        cell: (info) => {
          const gender = (info.getValue() as string) || '';
          const genderLower = gender.toLowerCase();
          let genderClass = 'gender-pill gender-other';

          if (genderLower === 'male') genderClass = 'gender-pill gender-male';
          else if (genderLower === 'female') genderClass = 'gender-pill gender-female';

          const displayGender = gender
            ? gender.charAt(0).toUpperCase() + gender.slice(1).toLowerCase()
            : '';

          return <span className={genderClass}>{displayGender}</span>;
        },
      },
      {
        header: 'Request date',
        accessorKey: 'createdAt',
        cell: (info) => {
          const dateString = info.getValue() as string;
          try {
            const formattedDate = new Date(dateString).toLocaleDateString('en-US', {
              month: 'short',
              day: 'numeric',
              year: 'numeric',
            });
            return <span className="date-cell">{formattedDate}</span>;
          } catch {
            return <span className="date-cell">Invalid Date</span>;
          }
        },
      },
      {
        header: () => (
          <div className="country-header-with-filter">
            <span>Country</span>
            <button
              className="filter-icon-btn"
              onClick={toggleCountryFilter}
              aria-label="Filter by country"
            >
              <svg width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="currentColor">
                <path d="M3 5h18M6 12h12M10 19h4" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round" />
              </svg>
            </button>
            {showCountryFilter && (
              <div className="country-dropdown" role="dialog" aria-modal="false">
                <label className="dropdown-item">
                  <input
                    type="radio"
                    name="country-filter"
                    value=""
                    checked={!table.getColumn('country')?.getFilterValue()}
                    onChange={() => handleCountryFilterChange('')}
                  />
                  <span>All Countries</span>
                </label>
                {Array.from(new Set(taxes.map((t) => t.country))).sort().map((c) => (
                  <label key={c} className="dropdown-item">
                    <input
                      type="radio"
                      name="country-filter"
                      value={c}
                      checked={table.getColumn('country')?.getFilterValue() === c}
                      onChange={() => handleCountryFilterChange(c)}
                    />
                    <span>{c}</span>
                  </label>
                ))}
              </div>
            )}
          </div>
        ),
        accessorKey: 'country',
        cell: (info) => <span className="country-cell">{info.getValue() as string}</span>,
      },
      {
        header: 'Actions',
        accessorKey: 'id',
        cell: (info) => (
          <button
            onClick={() => handleEdit(info.row.original)}
            className="edit-btn"
            title="Edit"
          >
            <svg width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor">
              <path d="M11 4H4a2 2 0 0 0-2 2v14a2 2 0 0 0 2 2h14a2 2 0 0 0 2-2v-7" />
              <path d="M18.5 2.5a2.121 2.121 0 0 1 3 3L12 15l-4 1 1-4 9.5-9.5z" />
            </svg>
          </button>
        ),
      },
    ],
    [taxes, showCountryFilter]
  );

  const table = useReactTable({
    data: taxes,
    columns,
    state: {
      columnFilters,
    },
    onColumnFiltersChange: setColumnFilters,
    getCoreRowModel: getCoreRowModel(),
    getFilteredRowModel: getFilteredRowModel(),
    getSortedRowModel: getSortedRowModel(),
  });

  if (loading) {
    return <div className="table-loading">Loading taxes...</div>;
  }

  return (
    <div className="tax-table-container">
      <div className="table-header">
        <h3>Tax Records</h3>
      </div>

      <div className="results-info">
        Showing {table.getRowModel().rows.length} of {taxes.length} records
        {(table.getColumn('country')?.getFilterValue() as string) && (
          <span className="filter-active">
            â€¢ Filtered by: {(table.getColumn('country')?.getFilterValue() as string)}
          </span>
        )}
      </div>

      <div className="table-wrap">
        <table className="tax-table">
          <thead>
            {table.getHeaderGroups().map((headerGroup) => (
              <tr key={headerGroup.id}>
                {headerGroup.headers.map((header) => (
                  <th key={header.id} className="table-th">
                    {flexRender(header.column.columnDef.header, header.getContext())}
                  </th>
                ))}
              </tr>
            ))}
          </thead>
          <tbody>
            {table.getRowModel().rows.map((row) => (
              <tr key={row.id} className="table-row">
                {row.getVisibleCells().map((cell) => (
                  <td key={cell.id} className="table-td">
                    {flexRender(cell.column.columnDef.cell, cell.getContext())}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {table.getRowModel().rows.length === 0 && !loading && (
        <div className="no-data">
          No records found
          {(table.getColumn('country')?.getFilterValue() as string) && (
            <span> for country "{(table.getColumn('country')?.getFilterValue() as string)}"</span>
          )}
        </div>
      )}

      {isModalOpen && (
        <EditModal
          isOpen={isModalOpen}
          onClose={handleCloseModal}
          onSave={handleSave}
          initialData={getEditInitialData()}
          countries={countries}
        />
      )}
    </div>
  );
};
